    .navbar{height:65px;display:flex;align-items:center;justify-content:space-between;padding:0 2.5rem;border-bottom:1px solid rgba(45,212,191,0.1);background:rgba(0,0,0,0.3);backdrop-filter:blur(24px);flex-shrink:0}
    .nav-brand{font-family:'Syne',sans-serif;font-weight:800;font-size:1.2rem;letter-spacing:.08em;color:var(--text);display:flex;align-items:center;gap:10px}
    .nav-star{width:22px;height:22px;animation:starSpin 8s linear infinite}
    @keyframes starSpin{to{transform:rotate(360deg)}}
    .nav-links{display:flex;align-items:center;gap:2rem;font-family:'DM Sans',sans-serif;font-size:.82rem}
    .nav-links a{color:var(--muted);text-decoration:none;text-transform:uppercase;transition:color .3s;cursor:none}
    .nav-links a:hover{color:var(--cyan)}

    .hero{flex:1;display:flex;align-items:center;justify-content:center;position:relative;overflow:hidden}
    #loadingMsg{position:absolute;font-family:'DM Sans',sans-serif;font-size:.75rem;letter-spacing:.2em;text-transform:uppercase;color:rgba(45,212,191,0.6);animation:blink 1.5s ease-in-out infinite;z-index:10}
    @keyframes blink{0%,100%{opacity:.4}50%{opacity:1}}
    #dragHint{position:absolute;bottom:80px;left:50%;transform:translateX(-50%);font-family:'DM Sans',sans-serif;font-size:.65rem;letter-spacing:.25em;text-transform:uppercase;color:rgba(200,220,225,0.35);display:flex;align-items:center;gap:8px;z-index:10;animation:hintFade 3s 2s forwards}
    @keyframes hintFade{0%{opacity:1}80%{opacity:1}100%{opacity:0}}
    #threeCanvas{width:100%;height:100%;display:block}

    .bottom-login{position:absolute;bottom:28px;left:50%;transform:translateX(-50%);z-index:10;animation:loginReveal 1.5s 1s cubic-bezier(.22,1,.36,1) both}
    @keyframes loginReveal{from{opacity:0;transform:translateX(-50%) translateY(20px)}to{opacity:1;transform:translateX(-50%) translateY(0)}}
    .login-btn{display:flex;align-items:center;gap:10px;padding:10px 28px;background:rgba(0,0,0,0.4);border:1px solid rgba(45,212,191,0.3);border-radius:50px;font-family:'DM Sans',sans-serif;font-size:.8rem;letter-spacing:.12em;text-transform:uppercase;color:rgba(220,235,240,0.85);cursor:none;transition:all .3s;backdrop-filter:blur(18px);position:relative;overflow:hidden}
    .login-btn::before{content:'';position:absolute;inset:0;background:linear-gradient(135deg,rgba(45,212,191,0.1),rgba(139,92,246,0.07));opacity:0;transition:opacity .3s}
    .login-btn:hover::before{opacity:1}
    .login-btn:hover{border-color:rgba(45,212,191,0.7);color:#fff;box-shadow:0 0 25px rgba(45,212,191,0.2)}
    .login-dot{width:6px;height:6px;border-radius:50%;background:var(--cyan);box-shadow:0 0 8px var(--cyan);animation:livePulse 2s ease-in-out infinite}
    @keyframes livePulse{0%,100%{opacity:1;transform:scale(1)}50%{opacity:.4;transform:scale(.8)}}
    .login-divider{width:1px;height:14px;background:rgba(45,212,191,0.25)}

    .modal-overlay{position:fixed;inset:0;z-index:500;background:rgba(0,0,0,0.88);backdrop-filter:blur(20px);display:flex;align-items:center;justify-content:center;opacity:0;pointer-events:none;transition:opacity .3s}
    .modal-overlay.show{opacity:1;pointer-events:all}
    .modal-card{background:rgba(4,5,18,0.97);border:1px solid rgba(45,212,191,0.1);border-radius:20px;padding:40px 38px;width:360px;max-width:90vw;position:relative;overflow:hidden;transform:translateY(30px) scale(.96);transition:transform .35s cubic-bezier(.22,1,.36,1);box-shadow:0 40px 100px rgba(0,0,0,0.8),inset 0 1px 0 rgba(255,255,255,0.05)}
    .modal-overlay.show .modal-card{transform:translateY(0) scale(1)}
    .modal-card::before{content:'';position:absolute;top:0;left:0;right:0;height:2px;background:linear-gradient(90deg,transparent,var(--cyan),var(--purple),transparent)}
    .modal-close{position:absolute;top:16px;right:16px;width:30px;height:30px;background:rgba(255,255,255,0.04);border:1px solid var(--border);border-radius:8px;color:var(--muted);font-size:.8rem;cursor:none;display:flex;align-items:center;justify-content:center;transition:all .2s}
    .modal-close:hover{border-color:rgba(45,212,191,0.5);color:var(--cyan)}
    .modal-title{font-family:'Syne',sans-serif;font-size:1.4rem;font-weight:800;color:var(--text);margin-bottom:4px}
    .modal-sub{font-family:'DM Sans',sans-serif;font-size:.75rem;color:var(--muted);letter-spacing:.05em;margin-bottom:28px}
    .field{margin-bottom:14px}
    .field label{display:block;font-family:'DM Sans',sans-serif;font-size:.65rem;letter-spacing:.18em;text-transform:uppercase;color:var(--muted);margin-bottom:7px}
    .input-wrap{position:relative}
    .input-wrap i{position:absolute;left:13px;top:50%;transform:translateY(-50%);font-size:.8rem;color:rgba(160,160,192,0.3);pointer-events:none}
    .field input{width:100%;background:rgba(255,255,255,0.03);border:1px solid var(--border);border-radius:10px;padding:11px 14px 11px 38px;color:var(--text);font-family:'DM Sans',sans-serif;font-size:.9rem;outline:none;transition:all .3s;cursor:none}
    .field input::placeholder{color:rgba(160,160,192,0.2)}
    .field input:focus{border-color:rgba(45,212,191,0.5);background:rgba(45,212,191,0.03);box-shadow:0 0 0 3px rgba(45,212,191,0.07)}
    .row-opts{display:flex;align-items:center;justify-content:space-between;margin:-2px 0 20px}
    .remember{display:flex;align-items:center;gap:7px;font-family:'DM Sans',sans-serif;font-size:.73rem;color:var(--muted);cursor:none}
    .remember input{accent-color:var(--cyan);cursor:none}
    .forgot{font-family:'DM Sans',sans-serif;font-size:.73rem;color:var(--cyan);text-decoration:none;opacity:.7;transition:opacity .2s;cursor:none}
    .forgot:hover{opacity:1}
    .submit-btn{width:100%;padding:12px;border:none;border-radius:10px;background:linear-gradient(135deg,var(--cyan),#38bdf8);color:#03040f;font-family:'Syne',sans-serif;font-size:.88rem;font-weight:700;letter-spacing:.1em;text-transform:uppercase;cursor:none;transition:all .3s;box-shadow:0 4px 25px rgba(45,212,191,0.25)}
    .submit-btn:hover{transform:translateY(-2px);box-shadow:0 8px 35px rgba(45,212,191,0.45)}
    .modal-footer{text-align:center;margin-top:18px;font-family:'DM Sans',sans-serif;font-size:.75rem;color:var(--muted)}
    .modal-footer a{color:var(--cyan);text-decoration:none;cursor:none}
    .modal-footer a:hover{color:#fff}
  </style>
</head>

(function aC(){cx+=(mx-cx)*.9;cy+=(my-cy)*.9;CE.style.transform=`translate(${cx-5}px,${cy-5}px)`;rx+=(mx-rx)*.1;ry+=(my-ry)*.1;RE.style.transform=`translate(${rx-19}px,${ry-19}px)`;requestAnimationFrame(aC)})();

const stC=document.getElementById('starCanvas'),stCtx=stC.getContext('2d');
let SW,SH,stars=[];
function resizeStar(){SW=stC.width=innerWidth;SH=stC.height=innerHeight}
function initStars(){
  stars=Array.from({length:130},()=>{
    const cols=[[210,225,235],[195,215,228],[220,232,240],[200,220,230],[235,242,248]];
    const col=cols[Math.floor(Math.random()*cols.length)];
    return{x:Math.random()*SW,y:Math.random()*SH,
      sz:Math.random()<.75?.2+Math.random()*.35:.4+Math.random()*.65,
      a:.02+Math.random()*.11,da:(.0005+Math.random()*.002)*(Math.random()<.5?1:-1),col};
  });
}
function drawStars(){
  stCtx.clearRect(0,0,SW,SH);
  stars.forEach(s=>{
    s.a+=s.da;if(s.a>.14||s.a<.015)s.da*=-1;
    stCtx.beginPath();stCtx.arc(s.x,s.y,s.sz,0,Math.PI*2);
    stCtx.fillStyle=`rgba(${s.col[0]},${s.col[1]},${s.col[2]},${s.a})`;stCtx.fill();
  });
  requestAnimationFrame(drawStars);
}
resizeStar();initStars();drawStars();
window.addEventListener('resize',()=>{resizeStar();initStars()});

const gltfBlob=new Blob([atob(gltfB64)],{type:'model/gltf+json'});
const gltfUrl=URL.createObjectURL(gltfBlob);
const loader=new GLTFLoader();
let model=null,mixer=null,clock=new THREE.Clock();
loader.load(gltfUrl,gltf=>{
  URL.revokeObjectURL(gltfUrl);
  model=gltf.scene;
  const box=new THREE.Box3().setFromObject(model);
  const center=box.getCenter(new THREE.Vector3());
  const size=box.getSize(new THREE.Vector3());
  const scale=1.904/Math.max(size.x,size.y,size.z);
  model.position.sub(center.multiplyScalar(scale));
  model.scale.setScalar(scale);
  if(gltf.animations?.length>0){mixer=new THREE.AnimationMixer(model);gltf.animations.forEach(c=>mixer.clipAction(c).play())}
  scene.add(model);loadMsg.style.display='none';resizeThree();
},xhr=>{
  const p=xhr.total?Math.round(xhr.loaded/xhr.total*100):0;
  loadMsg.textContent=`Cargando... ${p}%`;
},err=>{loadMsg.textContent='Error: '+err.message});

let isDragging=false,prevX=0,prevY=0,rotX=0,rotY=0,velX=0,velY=0;
let floatT=0,autoRotY=0,isInteracting=false,iTimer=null;
canvas.addEventListener('mousedown',e=>{isDragging=true;isInteracting=true;prevX=e.clientX;prevY=e.clientY;CE.classList.add('dragging');clearTimeout(iTimer)});
window.addEventListener('mousemove',e=>{if(!isDragging||!model)return;const dx=e.clientX-prevX,dy=e.clientY-prevY;velX=dy*.008;velY=dx*.008;rotX+=velX;rotY+=velY;model.rotation.x=rotX;model.rotation.y=rotY;prevX=e.clientX;prevY=e.clientY});
window.addEventListener('mouseup',()=>{
  isDragging=false;CE.classList.remove('dragging');
  iTimer=setTimeout(()=>{
    isInteracting=false;
    const tp=Math.PI*2;
    rotY=rotY-Math.round(rotY/tp)*tp;rotX=rotX-Math.round(rotX/tp)*tp;
    velX=0;velY=0;autoRotY=rotY;
  },2000);
});
function animate(){
  requestAnimationFrame(animate);
  const delta=clock.getDelta();floatT+=.012;
  if(mixer)mixer.update(delta);
  if(model&&!isDragging){
    if(!isInteracting){
      autoRotY+=.004;
      model.rotation.y=autoRotY+Math.sin(floatT*.6)*.08;
      model.rotation.x=Math.sin(floatT*.4)*.04;
      model.position.y=Math.sin(floatT)*.12;
    } else {
      velX*=.92;velY*=.92;rotX+=velX;rotY+=velY;
      model.rotation.x=rotX;model.rotation.y=rotY;
    }
  }
  pC.position.x=Math.sin(floatT*.8)*3;pC.position.y=Math.cos(floatT*.6)*2;
  pP.position.x=-Math.sin(floatT*.7)*3;pP.position.y=Math.sin(floatT*.9)*2;
  renderer.render(scene,camera);
}
animate();resizeThree();
window.addEventListener('resize',resizeThree);
</script>
